import './App.css';
import Button from './Button';
function App() {
  return (
    <div className="App">
        <Button onClick={async () => {
            const response = await fetch('http://localhost:5169/api/Authificate/test', {
                method: 'POST',
                headers: {'Content-Type': 'application/json'},
                credentials: 'include',
                body: {
                    "message": 'hui'
                }.json()
            });

            const content = await response.json();
            console.log(content)
        }}>Button text</Button>

        <header className="App-header">
      </header>
    </div>
  );
}

export default App;
